use std::collections::HashSet;

fn main() {
    let line: Vec<char> = "".chars().collect();
    let mut s = HashSet::new();
    let mut start = 0;
    let size = 14;

    loop {
        for i in 0..size {
            s.insert(line[start + i].clone());
        }

        if s.len() == size {
            println!("found {}, {:?}", start + size, s);
            break;
        }

        start += 1;
        s.clear();

        if start + size >= line.len() {
            println!("not found");
            break;
        }
    }
}
